import React from 'react';
import ProjectList from './ProjectList';

const Home = () => {
    return (
        <main>
            <header>
                <img src="../images/logo.svg"></img>
                <h1>Luca Troger</h1>
                <p>Willkommen auf meiner Portfolio-Seite. <br></br> Hier finden Sie Infos über mich und meine Projekte sowie die Möglichkeit mich zu kontaktieren.</p>
            </header>
                <ProjectList />
        </main>
    );
};

export default Home;
